        mHdltvinHandle << " , " <<  " \"hw_crtc_ofl_i\" :  \"" << hw_crtc_ofl_i.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"hw_crtc_ofl_o\" :  \"" << hw_crtc_ofl_o.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"hw_crtc_ofl_o_ap_vld\" :  \"" << hw_crtc_ofl_o_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cfb_dummy\" :  \"" << cfb_dummy.read() << "\" ";
